import React from 'react';
import OrganismList from './OrganismList';

class ConfigPanel extends React.Component {
    constructor(props: Readonly<{}>) {
        super(props);
        this.state = {
            organisms: [],
            selectedOrganism: '',
            organismConfigs: {},
        }
    }
    render() {
        return (
            <div>
                <h1>This is the config Panel</h1>
                <OrganismList />
            </div>
        )
    }
}

export default ConfigPanel;
